UNIT__SORCERESS__NAME:"Häxa",UNIT__WISP__NAME:"Wisp",UNIT__DIRE_WOLF__NAME:"Skräckulv",UNIT__GOLEM__NAME:"Golem",UNIT__CATAPULT__NAME:"Katapult",UNIT__DRAGON__NAME:"Drake",UNIT__SKELETON__NAME:"Skelett",UNIT__GALAMAR__NAME:"Galamar",UNIT__VALADORN__NAME:"Valadorn",UNIT__DEMON_LORD__NAME:"Demonisk Lord",UNIT__SAETH__NAME:"Saeth",UNIT__CRYSTAL__NAME:"Kristall",UNIT__SAETH_HEAVENS_FURY__NAME:"Saeth",UNIT__SOLDIER__DESCRIPTION:"Soldater är de starka allroundkämpar krigare som utgör grunden i vilken armé som helst. Soldaterna är också den enda truppen som kan erövra städer som genererar guld.",UNIT__ARCHER__DESCRIPTION:"Med sina kraftfulla bågar kan bågskyttarna angripa på avstånd och är särskilt effektiva mot flygande fiender",UNIT__ELEMENTAL__DESCRIPTION:"Elementaler är magiska vattenandar. I vattnet är elementalerna snabbare och bättre skyddade.",UNIT__SORCERESS__DESCRIPTION:"Häxor är duktiga på att använda magi, men de är svaga i närkamp. Men deras förmåga att framkalla skelett från döda trupper kan vara avgörande i strid.",UNIT__WISP__DESCRIPTION:"Dessa mystiska varelser av rent ljus utstrålar en aura som förstärker de närliggande vänliga truppens angreppsförmåga. I närkamp är de särskilt dödliga mot skelett.",UNIT__DIRE_WOLF__DESCRIPTION:"Skräckulvarna är farliga jägare som förflyttar sig i flockar. Var försiktig - deras bett är giftigt och minskar både attack och försvar nivåer på en gång.",UNIT__GOLEM__DESCRIPTION:"Golemer är uråldriga varelser - långsamma men oerhört starka i sitt försvar. En golem som är placerad i en byggnad eller på en väl skyddad bergstopp är mycket svår att besegra.",UNIT__CATAPULT__DESCRIPTION:"Katapulter skapar en rad förstörelse överallt de når med sitt enorma attackområde. Men deras relativa stillastående och oförmåga att attackera på nära håll gör dem sårbara, så skydda dem väl.  Katapulter kan antingen förflytta sig eller attackera under en tur, men bara en sak per tur.",UNIT__DRAGON__DESCRIPTION:"Dessa enorma flygande varelser har härskat över bergen av dimma sedan urminnes tider. De är extremt rörliga och också dödliga i angrepp på land, i luften och i havet.",UNIT__SKELETON__DESCRIPTION:"Dessa livlösa krigare som är tillkallade av häxor är lika starka soldater och dödliga motståndare på vilket slagfält som helst.",UNIT__GALAMAR__DESCRIPTION:"Galamar (befälhavare) är väldigt stark i attack och försvar. Befälhavaren kan också ockupera slott för att producera trupper och de kan återupplivas i slottet om de faller i strid.",UNIT__VALADORN__DESCRIPTION:"Valadorn (befälhavare) är väldigt stark i attack och försvar. Befälhavaren kan också ockupera slott för att producera trupper, och de kan återupplivas i slottet om de faller i strid.",UNIT__DEMON_LORD__DESCRIPTION:"Demonisk Lord (befälhavare) är väldigt stark i attack och försvar. Befälhavaren kan också ockupera slott för att producera trupper, och de kan återupplivas i slottet om de faller i strid.",UNIT__SAETH__DESCRIPTION:"Saeth (befälhavare) är väldigt stark i attack och försvar. Befälhavaren kan också ockupera slott för att producera trupper, och de kan återupplivas i slottet om de faller i strid.",UNIT__CRYSTAL__DESCRIPTION:"Dessa legendariska kristaller var ursprungligen grävda ur ruinerna av det antika citadellet. Det är lite som är känt om deras styrka, förutom, det ryktas, kan de skydda kungariket, och även har makten att förstöra det.",UI__BUTTON__PLAY:"Spela",UI__BUTTON__SETTINGS:"Inställningar",UI__BUTTON__MAP_EDITOR:"Kartredigerare",UI__BUTTON__INSTRUCTIONS:"Instruktioner",UI__BUTTON__ABOUT:"Om app",UI__BUTTON__COMPANIES:"Kampanjer",UI__BUTTON__LOAD_GAME:"Laddning av nivån",UI__BUTTON__SKIRMISH:"Slagsmål",UI__BUTTON__USER_MAPS:"Användarkartor",UI__BUTTON__MISSION:"Uppdrag",SETUP_SKIRMISH__PLAYER:"Spelare",SETUP_SKIRMISH__BOT:"Bot",SETUP_SKIRMISH__NONE:"Inget",SETUP_SKIRMISH__TEAM:"Lag {number}",SETUP_SKIRMISH__MONEY:"Pengar",SETUP_SKIRMISH__UNIT_LIMIT:"Truppgräns",SETUP_SKIRMISH__FIGHT:"Till strid!",GAME__END_TURN:"Avsluta turen",GAME